import React from "react";
import style from "./a.module.css";
import footer from "../../assets/footer.png";
import icon1 from "../../assets/icon1.svg";
import icon2 from "../../assets/icon2.svg";
import icon3 from "../../assets/icon3.svg";
import icon4 from "../../assets/icon4.svg";

const Footer = () => {
  return (
    <div>
      <div className={style.contentDiv}>
        <div className={style.compInfo}>
			<div>

			</div>
			<h5>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</h5>
		</div>
        <div className={style.menuDiv}>
			<h3>Menu</h3>
			<h5>Home</h5>
			<h5>About</h5>
			<h5>Course</h5>
			<h5>Blog</h5>
		</div>
        <div className={style.contactDiv}>
			<h3>Contact Us</h3>
		</div>
      </div>
      <div className={style.endDiv}>
		<div className={style.line}></div>
		<p>Copyright Â©2022 All rights reserved</p>
	  </div>
      <h1>sdfasd</h1>
      <img src={footer} alt="" className={style.footer} />
    </div>
  );
};

export default Footer;
